#include "gtest/gtest.h"
#include <vector>
#include <random>
#include "./../minimum_time_to_schedule_n_bus_trips.h"


template<typename T>
requires std::unsigned_integral<T>
std::vector<T> get_N_random_number_vector(const T lower_bound,
										  const T upper_bound,
										  const size_t size)
{
	std::uniform_int_distribution<T> int_distribution = std::uniform_int_distribution{lower_bound, upper_bound};
	std::vector<T> result;
	std::mt19937 random_engine{std::random_device{}()};
	for (size_t i{}; i < size; ++i) {
		result.push_back(int_distribution(random_engine));
	}
	return result;
}


TEST(minimum_time_to_schedule_n_bus_trips, random)
{
	std::vector<size_t> bus_times{1, 2, 3};
	int total_trips{5};
	int expected_answer{3};
	auto answer = minimum_time_to_schedule_n_bus_trips<std::vector<size_t>, unsigned long>(bus_times, total_trips);
	EXPECT_EQ(expected_answer, answer);
}

